import time
class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # print(s[0:1])
        # if len(s) == 0:
        #     return 0
        # count = 1
        # i = 0
        # while i < len(s):
        #     j = i+1
        #     r = {s[i]:''}
        #     while j < len(s):
        #         if r.__contains__(s[j]):
        #             i = s.index(s[j])
        #             r = {}
        #             break
        #         else:
        #             r.update({s[j]: ''})
        #         print(r)
        #         count = max(len(r), count)
        #         if j == len(s)-1:
        #             return count
        #         j += 1
        #     i += 1
        count = 0
        length = len(s)
        i,j = 0,0
        # 判断i-j区间内是否包含j,如果不包含j继续往后走，如果包含，i调到j的位置后继续往后走，统计最长的区间
        #O(2n) = O(n)，最坏情况，每个字符被ij访问两次
        while i < length and j < length:
            if s[j] in s[i:j]:
                count = max(j - i, count)
                i = i + s[i:j].index(s[j]) + 1
            else:
                j += 1
                count = max(j - i, count)
        return count

